func build_sbom(package_info map[string]string) *sbommodel.SBOMEntity {

	version := int32(1)
	Pvalue := "python-pkg"

	name, done := package_info["Name"]
	if !done {
		fmt.Println("no name in package ", name)
		return nil
	}
	version_package, done2 := package_info["Version"]
	if !done2 {
		fmt.Println("no version in package ", version_package)
		return nil
	}
	home_package, done2 := package_info["PURL"]
	if !done2 {
		fmt.Println("no Home-page in package ", home_package)
		return nil
	}

	id, done3 := package_info["ID"]
	if !done3 {
		fmt.Println("no ID in package sbom ", id)
		return nil
	}

	bom_ref, done4 := package_info["BOMREF"]
	if !done4 {
		fmt.Println("no BOMREF in package sbom ", name)
		return nil
	}

	license, done5 := package_info["License"]
	if !done5 {
		fmt.Println("no License in package sbom ", name)
		return nil
	}
	now := ttpb.New(time.Now())
	vendor := "aquasecurity"
	tool_name := "trivy"
	p_value_in := "2"
	file_path := fmt.Sprintf("%s-%s.dist-info/METADATA", name, version_package)

	bom := &cyclonedx.Bom{

		SerialNumber: &id,
		SpecVersion:  "1.4",
		Version:      &version,
		Metadata: &cyclonedx.Metadata{
			Timestamp: now,
			Tools: []*cyclonedx.Tool{
				{
					Vendor: &vendor,
					Name:   &tool_name,
				},
			},
			Component: &cyclonedx.Component{
				Type:   cyclonedx.Classification_CLASSIFICATION_APPLICATION,
				Name:   "/var/folders/papazian/code",
				BomRef: &id,
				Properties: []*cyclonedx.Property{
					{
						Name:  "aquasecurity:trivy:SchemaVersion",
						Value: &p_value_in,
					},
				},
			},
		},
		Components: []*cyclonedx.Component{
			{
				Type:    cyclonedx.Classification_CLASSIFICATION_LIBRARY,
				Name:    name,
				Version: version_package,
				Licenses: []*cyclonedx.LicenseChoice{
					{
						Choice: &cyclonedx.LicenseChoice_Expression{license},
					},
				},
				Purl:   &home_package,
				BomRef: &bom_ref,
				Properties: []*cyclonedx.Property{
					{
						Name:  "aquasecurity:trivy:PkgType",
						Value: &Pvalue,
					},
					{
						Name:  "aquasecurity:trivy:FilePath",
						Value: &file_path,
					},
				},
			},
		},
		Dependencies: []*cyclonedx.Dependency{
			{
				Ref: id,
				Dependencies: []*cyclonedx.Dependency{
					{
						Ref: bom_ref,
					},
				},
			},
		},
	}

	pp.Println("BOM", bom)

	entity := &sbommodel.SBOMEntity{
		Status: sbommodel.SBOMStatus_SUCCESS,
		Type:   sbommodel.SBOMSourceType_CI_PIPELINE, // TODO: SBOMSourceType_LAMBDA
		Id:     "sbomapp7",                           // service name
		InUse:  true,
		Sbom: &sbommodel.SBOMEntity_Cyclonedx{
			Cyclonedx: bom,
		},
		DdTags: []string{
			"eenv:system-tests",
			"git.repository_url:github.com/Datadog/sbom-app",
			"git.branch:main",
			"sidescanner_host",
			"unknown",
		},
		GeneratedAt:        ttpb.New(time.Now()),
		GenerationDuration: durationpb.New(time.Duration(1) * time.Microsecond),
		//Hash:               "",
	}
	pp.Println("ENTITY", entity)

	return entity
}

